import React from "react";

const Education = () => {
  return (
    <div className="education">
      <p>Bootcamp, Front-end Developer - Adalab Promo M 2021 (Finished)</p>
      <p className="education-1">
        Specialization in UI UX Design- California Institute of the Arts, on
        Coursera 2020-2021 (3/4 to be finished){" "}
      </p>
      <p>
        Universidad Complutense de Madrid- Master in Organizational Psychology
        2012-2013 (Finished) Universidad Católica Andrés Bello- Lic. in Human
        Resources 2004-2009 (Finished){" "}
      </p>
    </div>
  );
};

export default Education;
